import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  render() {
    return (
      <div className="App">
        <div id="calc-container" className="container center vh20">
          <input className="w-100" type="text" />
          <button
            onPress={() => {
              alert("Clicked");
            }}
          />
        </div>
      </div>
    );
  }
}

export default App;
